console.info("%c CURTAIN-CARD %c 0.1.3","color: white; background: green; font-weight: 700;","color: green; background: white; font-weight: 700;");

class CurtainCard extends HTMLElement {
    set hass(hass){
        const _this = this;
        this._hass = hass;
        if(!this.card){
            //Init the card
            const card = document.createElement("ha-card");
            if(this._config.title){
                card.header = this._config.title;
            }
            if(!(this._config.size.constructor != "Number")){
                this._config.size = 260;
            }
            if(this._config.size > 800){
                this._config.size = 800;
            }else if(this._config.size < 100){
                this._config.size = 100;
            }
            this.last_state = "none";
            const container = document.createElement("div");
            container.className = "curtain-card-container";
            const windows = document.createElement("div");
            windows.className = "curtain-card-windows";
            const scene = document.createElement("div");
            scene.className = "curtain-card-scene";
            const sceneImage = document.createElement("img");
            sceneImage.className = "curtain-card-scene-image";
            const divWindow = document.createElement("div");
            divWindow.className = "curtain-card-window";
            divWindow.innerHTML = `<img class="curtain-card-window-image" src="data:image/png;base64,"/>`;
            const curtain = document.createElement("div");
            curtain.className = "curtain-card-curtain";
            curtain.innerHTML = `<img class="curtain-card-curtain-image" src="data:image/png;base64,">`;
            const mask = document.createElement("div");
            mask.className = "curtain-card-mask";
            const slider = document.createElement("div");
            slider.className = "curtain-card-slider";
            const label = document.createElement("div");
            label.className = "curtain-card-label";
            const style = document.createElement('style');

            style.textContent = `
                .curtain-card-container{padding:16px;}
                .curtain-card-scene{position:absolute;z-index:1;display:block;width:80%;height:68%;top:16%;left:10%;}
                .curtain-card-scene-image{width:100%;height:100%;}
                .curtain-card-windows{position:relative;margin:auto;}
                .curtain-card-window{position:absolute;z-index:2;width:100%;height:100%;}
                .curtain-card-window-image{width:100%;height:auto;}
                .curtain-card-curtain{position: absolute;z-index:3;height:100%;}
                .curtain-card-curtain-image{width:100%;height:100%;}
                .curtain-card-mask{position: absolute;z-index:4;height:100%;}
                .curtain-card-slider{position: absolute;z-index:5;width:10%;height:100%;cursor:pointer;}
                .curtain-card-label{display: inline-block; vertical-align: middle; padding: 16px 0px 0px 0px; width:100%;text-align:center}
            `;

            if(this._config.sceneImage){
                sceneImage.src = this._config.sceneImage;
            }
            mask.style.background = this._config.curtainColor;
            windows.style.width = this._config.size + "px";
            windows.style.height = this._config.size + "px";
            scene.appendChild(sceneImage);
            windows.appendChild(scene);
            windows.appendChild(divWindow);
            windows.appendChild(curtain);
            windows.appendChild(mask);
            windows.appendChild(slider);
            container.appendChild(windows);
            if(this._config.showStatus){
                container.appendChild(label);
            }
            card.appendChild(container);
            this.appendChild(card);
            this.appendChild(style);
            this.windows = windows;
            this.card = card;
            this.curtain = curtain;
            this.mask = mask;
            this.slider = slider;
            this.label = label;



            let mouseDown = function(event){
                if(event.cancelable){
                    event.preventDefault();
                }
                _this.isUpdating = true;
                _this.StartPos = event.pageX;
                document.addEventListener('mousemove', mouseMove);
                document.addEventListener('touchmove', mouseMove);
                document.addEventListener('pointermove', mouseMove);

                document.addEventListener('mouseup', mouseUp);
                document.addEventListener('touchend', mouseUp);
                document.addEventListener('pointerup', mouseUp);
            };

            let mouseMove = function(event){
                _this.setNewPos(event.pageX - _this.StartPos, false);
            };

            let mouseUp = function(event){
                _this.isUpdating = false;
                _this.setNewPos(event.pageX - _this.StartPos, true);
                document.removeEventListener('mousemove', mouseMove);
                document.removeEventListener('touchmove', mouseMove);
                document.removeEventListener('pointermove', mouseMove);

                document.removeEventListener('mouseup', mouseUp);
                document.removeEventListener('touchend', mouseUp);
                document.removeEventListener('pointerup', mouseUp);
            };
            slider.addEventListener('mousedown', mouseDown);
            slider.addEventListener('touchstart', mouseDown);
            slider.addEventListener('pointerdown', mouseDown);
        }
        //update UI
        const curtainObj = hass.states[this._config.entity];
        if(curtainObj && !this.isUpdating){
            if(this.last_state != "closing" && this.last_state != "opening" ){
                if(curtainObj.state != "closing" && curtainObj.state != "opening")
                {
                    let invertPercentage = false;
                    if(curtainObj.invert_percentage){
                        invertPercentage = curtainObj.invert_percentage;
                    }else{
                        invertPercentage = this._config.invertPercentage;
                    }
                    const state = hass.states[this._config.entity];
                    this.currentPosition = state ? state.attributes.current_position : "unknown";
                    if(this.currentPosition != "unknown"){
                        if(invertPercentage){
                            this.setCurtainPos(100 - this.currentPosition);
                        } else {
                            this.setCurtainPos(this.currentPosition);
                        }
                        this.label.innerHTML = this.currentPosition + "%";
                    }else{
                        this.label.innerHTML = "Unknown";
                    }
                }else{
                    this.label.innerHTML = curtainObj.state;
                }
            }
            this.last_state = curtainObj.state;
        }
    }
    setConfig(config){
        if(!config.entity){
          throw new Error("You need to define a entity");
        }
        this._config = {
            curtainColor: "background:RGB(39,177,220,0.4);",
            invertPercentage: false,
            direction: "right",
            showStatus: true,
            size: 260,
            sceneImage: "data:image/png;base64,",
            ...config
        };
        this.isUpdating = false;
    }

    setCurtainPos(pos){
        const new_pos = 86 - 0.7 * pos;
        this.curtain.style.width = new_pos + "%";
        this.mask.style.width = new_pos + "%";
        if(this._config.direction.toLowerCase() == "right"){
            const left = 7 + 0.7 * pos;
            this.curtain.style.left = left + "%";
            this.mask.style.left = left + "%";
            this.slider.style.left = (left - 5) + "%";
        } else {
            this.curtain.style.left = "7%";
            this.mask.style.left = "7%";
            this.slider.style.left = (new_pos + 7 - 5) + "%";
        }
    }

    setNewPos(offset, call_service){
        let width = this.windows.clientWidth * 0.7;
        let moves = offset * 100 / width;
        if(moves > 1 || moves < -1){
            let new_pos = this._config.direction.toLowerCase() == "right"?
                this.currentPosition + moves: this.currentPosition - moves;
            new_pos = Math.round(new_pos);
            if(new_pos < 0){
                new_pos = 0;
            }else if(new_pos > 100){
                new_pos = 100;
            }
            if(new_pos != this.currentPosition){
                if(this._config.invertPercentage){
                    this.setCurtainPos(100 - new_pos);
                    if(call_service){
                        this._hass.callService("cover", "set_cover_position", {
                            entity_id: this._config.entity,
                            position: 100 - new_pos
                        });
                    }
                } else {
                    this.setCurtainPos( new_pos);
                    if(call_service){
                        this._hass.callService("cover", "set_cover_position", {
                            entity_id: this._config.entity,
                            position: new_pos
                        });
                    }
                }
            }
        }
    }
}

customElements.define("curtain-card", CurtainCard);